        <div className="card  bg-base-200 m-2 shadow-xl">
  <figure><img src="https://placeimg.com/400/225/arch" alt="Shoes" /></figure>
  <div className="card-body">
    <h2 className="card-title">
     {productImage}
      <div className="badge badge-secondary">NEW</div>
